type User = {
    /**
     * User id as defined by the database
     */
    id: number,
    /**
     * Users first name
     */
    first_name: string
    /**
     * Users last name
     */
    last_name: string
    /**
     * Users email
     */
    email: string
    /**
     * Users password
     */
    password: string
    /**
     * Users token
     */
    userToken: string
}
